export const Tasks = () => {
    const [tasks,setTasks] = useState([
        {
            id: 1,
            text : 'aaa',
            day : 'Feb 5th at 2:30pm',
            reminder: false,
        },
        {
            id: 2,
            text : 'BB',
            day : 'Feb 5th at 2:30pm',
            reminder: false,
        },
        {
            id: 3,
            text : 'CCC',
            day : 'Feb 5th at 2:30pm',
            reminder: false,
        }

    ])
    return (
        
        
        <>
        {tasks.map((task) => (
            <h3 key={task.id}>{task.text}</h3>
        ))}
            
        </>
    )
}
export default Tasks;
